import Link from 'next/link'

const Navigation = () => (
  <nav>
    <Link href="/">
      <a> To Index </a> 
    </Link>
    <Link href="/blog">
      <a>To Blog</a>
    </Link>
    
    <style jsx>{`
      body{
        font-family: sans-serif
      } 
      a {
        text-decoration: none
      }
    `}</style>
  </nav>
)

export default Navigation
